import { Grid, Card, Typography } from "@mui/material";
export default function NewProduct() {
    return (
        <Grid container>
            <Grid item xs={3}>
                <Card> 
                    <Typography>
                        New Product
                    </Typography>
                </Card>
            </Grid>
        </Grid>
    )
}
